INSERT INTO `application_master` VALUES (1,'Client Web View / Broker Order Entry Tool','Application that allows associates to view a clients account from the perspective of the client. Also allows brokers to enter orders and perform limited account functions on behalf of the client (e.g. Check Requests).',1,'Y','Y','Y',NULL,'?','Internal','AD','AD','?',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(2,'Compass (Siebel CRM)','CRM merges client information and account service tools into one “dashboard,\" which helps to coordinate customer service provided by the Service Center, Branch Operations and between branches. CRM maintains a large user base, approximately 75% of Scottrade associates.',1,'Y','Y','Y',NULL,'External','Internal','AD','Application','Siebel',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(3,'ECM Search & Workflow','There are several different software products (CE, Datacap, IBM Enterprise Records, TreX, and Workplace XT) that are combined to deliver the main products or ECM \"sub-applications\" (Scanning, Search, and Workflow). When someone is assigned access to ECM its usually to one of these three \"sub-applications\" through various AD group mappings into the various products. (certain groups, including ECM, have the ability to update meta data and/or add comments to work items)',1,'Y','Y','Y',NULL,'External','Internal','AD','AD','Multiple Vendors',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(4,'Equifaxs ePort','The Equifax ePort system is used to verify OFAC and/or credit information about 3rd party individuals or entities.',1,'N','Y','Y',NULL,'','External','Application','Application','Equifax',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(5,'SinglePoint','Information and transaction origination platform that is used for wire transfers and funds management for the Bank’s own checking account.',1,'N','Y','Y',NULL,'External','External','AD','Application','US Bank',NULL,NULL,NULL,10,'?','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(6,'Account Activation (same as CRI Activations)','Customer account activations and passwrd resets for branches. Must be in \"Activations group\" in AD',2,'N','Y','Y',NULL,'','Internal','OAM','AD and App Manager','',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(7,'CRI','Application used to place orders and maintain customer account information.',2,'N','Y','Y',NULL,'External','Internal','Application','Application','CRI',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(8,'CRI Admin (Trading Administration System; applications include Advanced Orders Exceptions, Approval Queue, Trade Research, and Trade Restrictions screens…)','Trading Administration System contains many sub-applications all which serve a unique and different purpose from one another. See document provided by Mitul Nakum for further detail.',2,'N','Y','Y',NULL,'','','','','',NULL,NULL,NULL,10,'','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(9,'CRI Profiles (Customer Profile)','view of clients CRI info, and provides special users access to customer passwords. No plan to remove. Application before CRM, gives quick view of customer info in CRI.',2,'N','Y','Y',NULL,'Internal','Internal','OAM','Application Manager (legacy apps)','Scottrade',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(10,'Datawatch ES Client','Datawatch ES Client is an end user interface that enables access to reports sourced from other systems, i.e. CRI. Users may view reports, search for data across multiple reports simultaneously, and manipulate data views to support analysis. Datawatch ES Client is one of three interrelated applications that separate and isolate functionality required by end users, system and application administrators (EUA) and Business Intelligence. Access to Datawatch ES Client is configured through the Datawatch ES Admin application. Reports available to end users through Datawatch ES Client are created in Monarch Pro.',2,'Y','Y','Y',NULL,'','Internal','AD','Application','',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(11,'Login Security Admin (Customer Setup, Login Security Admin, & Customer Activation Request)','The Login Admin group is used by various departments (Fraud and Loss Prevention, Branches, Branch Admin, Asia Pacific, etc.). Once the customer has been confirmed the representative can select a course of action based on the need of the customer: provide the account number, set the account so that the next time the customer logs in, they will be able to reset their password by answering security questions, reset the password to a default password, unlock the account (if the customer locked the account by answering the security questions incorrectly twice), or verify the customer\'s identity in the branch. The representative can also mark on this screen if the customer failed the identity verification or if they seem to be a suspicious caller. The WhiteList group access is provided to Fraud and Loss Prevention, QA, and Web Development (F&L primary user). Once a customer has been locked out of their account by missing all 4 security questions twice, and has had their identification verified (generally in person), a member of the WhiteList group can use their access to set the customer up with a 36 hour window (or permanently, but this is rarely used) to log into their account, select new security questions, and access their account as needed. The rep can also update the account status to active or inactive in this screen. The SecuritySettings access group is used by Application Support, Computer Operations and Web Development AD groups to set Operations parameters such as the number of failed attempts before the password lockout occurs, the application response delay that occurs when an incorrect account number password combination is used, or to enforce security enrollment (forced to enroll is security features, such as VeriSign).',2,'Y','Y','Y',NULL,'','Internal','AD','AD','',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(12,'Money Direct YCC (Yodlee Customer Care)','Administration tool provided by Yodlee used to see the accounts set up, whether deposits were successful, etc.',2,'N','Y','Y',NULL,'External','External','Application','Application','Money Direct',NULL,NULL,NULL,11,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(13,'Web CSR','Application used to view customer and employee bank account information. Access to PD Teller is provided thorugh the class code Employee Teller Services in Web CSR',2,'N','N','Y',NULL,'External','External','Application','Application','FIS',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(14,'ACE','The Automated Customer E-mail (ACE) application. Going into CRM *customer email only',3,'N','Y','Y',NULL,'','Internal','OAM/AD','Application Manager (legacy apps)','',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(15,'Admin Action','Dynamically generates letters to customers. Long-term, this will be in CRM.',3,'Y','Y','Y',NULL,'?','Internal','AD','AD','?',NULL,NULL,NULL,10,'N','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(16,'Apex (Penson Online)','OptionsFirst Clearing/Order Handling',3,'N','Y','Y',NULL,'','External','Application','Application','Apex',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(17,'Bank Branch Online Apply','Application accessible from the Client Website that allows existing brokerage clients to open Scottrade Bank accounts.',3,'Y','Y','Y',NULL,'','Internal','AD','AD','',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(18,'Bank Online Apply Manager','This is a webpage that allows the user to search for any application started or completed in Bank Consumer or Bank Branch Online Apply applications.',3,'Y','N','Y',NULL,'','Internal','AD','AD','',NULL,NULL,NULL,12,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(19,'Brokerage Branch Online Apply','System allows associates to open new brokerage and Scottrade Bank accounts for clients. Login via the MyApp link on the My Insider. The permissions are additionally done via the config file.',3,'Y','Y','Y',NULL,'','Internal','AD','AD','',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(20,'Client Order Admin','Allows brokers/home office to enter advanced orders for customers. It authenticates the user, using Active Directory, but the only restriction is that a branch broker must be accessing an account within his branch.',3,'Y','N','Y',NULL,'','Internal','AD','AD','',NULL,NULL,NULL,13,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(21,'Customer Email Search','Enter an e-mail, gets the clients acct number.',3,'Y','Y','Y',NULL,'','Internal','AD','AD','',NULL,NULL,NULL,12,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(22,'DNO Database','Shows people we cannot open an account for *SSN only',3,'N','Y','Y',NULL,'','Internal','OAM','Application Manager (legacy apps)','',NULL,NULL,NULL,8,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(23,'DTCC','Used to submit UITs for redemption.',3,'N','Y','Y',NULL,'','','','','',NULL,NULL,NULL,10,'','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(24,'Image Centre','The Lisle Data Center capture platform used to process all remittance work. Application provides research capabilities and contains the Chargeback Manager module for returned deposit item handling.',3,'N','Y','Y',NULL,'External','External','Application','Application','FIS',NULL,NULL,NULL,8,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(25,'Intercept','\"Intercept EFT\" - EFT system that provides network connections to ATM/Debit card networks and a secure debit program that provides fraud protection for lost, stolen or counterfeit debit cards.',3,'N','Y','Y',NULL,'External','External','Application','Application','FIS',NULL,NULL,NULL,8,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(26,'Knight BondPoint','ECN and OMS for fixed income trade activity. Also used as white label front-end for fixed income on Scottrade.com and ScottradeAdvisor.com. The customer will access through Scottrade.com and enter the order within BondPoint (through SSS). This sends the order info to Trader Workstation (backend web access to BondPoint). The info included are bond details (public), price (public) and an encrypted customer ID. This ID is decrypted using the MoneyDirect application. Once the ID is decrypted, the Scottrade user enters the info into CRI manually.',3,'N','Y','Y',NULL,'','External','Application','Application','Knight BondPoint',NULL,NULL,NULL,10,'N','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(27,'Leads','Manages customer Leads. Contains customer Name, Phone, Email.',3,'N','N','Y',NULL,'','','','','',NULL,NULL,NULL,12,'','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(28,'Message Center','Add messages to clients on scottrade.com',3,'N','N','Y',NULL,'','','','','',NULL,NULL,NULL,10,'','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(29,'Moxie Software Customer Spaces Channels (formerly Talisma)','Software platform for chat and email interactions used primarily by the Service Center. All client email routed to support@scottrade.com are processed through Moxie including secure messages initiated from the Message Center within client accounts. Service Center associates also use Moxie to chat with clients and prospects on the Marketing website as well as assisting clients through the Brokerage and Bank online application process. Other departments that use Moxie as an email response tool include SAS, New Accounts and Middle Office.',3,'Y','Y','Y',NULL,'','Internal','AD','Application','',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(30,'Mutual Fund Trading','Load Fund Family Viewer, Fund finder, Order Tracking and research. Contains 5 links to certain mutual funds',3,'Y','Y','Y',NULL,'','Internal','AD','AD','',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(31,'Portal - DQIS','Make adjustments for splits, dividends, and reorganizations. Use Ticker Plant information to validate trades. Changes must be made prior to market open.',3,'N','N','Y',NULL,'','','','','',NULL,NULL,NULL,9,'','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(32,'Referral Manager','Grants free trades *customer email and referral number only',3,'Y','Y','Y',NULL,'','Internal','AD','AD','',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(33,'Schwab Clearing Portal','0',3,'N','Y','Y',NULL,'','','','','',NULL,NULL,NULL,10,'','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(34,'SciVantage (ScottradePro)','Advisor tool for trade allocation acivity pertaining to client accounts.',3,'N','Y','Y',NULL,'','External','Application','Application','Scivantage',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(35,'SciVantage Maxit','Tax reporting module in the SAS Advisor trading website',3,'N','Y','Y',NULL,'','External','Application','Application','Scivantage',NULL,NULL,NULL,10,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(36,'Scottrade ELITEedge','ELITE Edge is used by service center brokers for stock symbol lookup, stock quotes, time and sales information. (The customer facing versions of ELITE Edge are Scottrader and Scottrade Elite)',3,'Y','Y','Y',NULL,'','Internal','Application','Application','',NULL,NULL,NULL,10,'N','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(37,'Trading Admin: ByPass Accounts','Development/QA use to manage accounts that are used for testing trading platforms when trading is turned off (these accounts are able to bypass trading controls). Users are allowed to add a new test account, or edit an existing account (i.e. change account status).',3,'Y','N','Y',NULL,'','Internal','AD','AD','',NULL,NULL,NULL,13,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(38,'Trading Admin: Leveraged ETFs','Any time a leveraged ETF is added or updated in CRI, the Security Master Department also adds/updates it in Trading Admin: Leveraged ETFs. In the application they can add a new symbol that has been identified as a leveraged ETF and assign it a maintenance type. Additionally they can change the maintenance type for an existing symbol. Finally they can edit the long and short percentages for a maintenance type. This data will be used as part of the Margin Redesign project.',3,'Y','N','Y',NULL,'','Internal','AD','AD','',NULL,NULL,NULL,13,'N','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(39,'Trading Admin: Vendor Admin','Rolled out with VeriSign to allow platform configurations for enhanced security as platforms communicate with each other. Allows for administration of tokens between platforms. The “global ID” is also known as the “vendor ID” and when the respective application calls a web service (such as the customer management service) it responds with an SSL (HTTPS) token that is “good” for the timeout value shown on these screens. There are also multiple session types and each type can have a specific timeout value.',3,'Y','N','Y',NULL,'','Internal','AD','AD','',NULL,NULL,NULL,13,'N','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(40,'VistaOne Regulatory Services','Used to access trade execution data',3,'N','Y','Y',NULL,'','','','','',NULL,NULL,NULL,12,'','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(41,'1099 Reallocations','1099 Reallocation is an intranet application and is used to assist customers who inquire about the dividend reporting classification. This application provides a list of basic information. You are able to perform a search on year, description, cusip and symbol. The options provided are Add, Edit, Delete and Info. The info from the 1099 is generated from being a contractor or doing any other outside work. Once the user enters the application, it will try to look them up in Active Directory. If they don’t have an entry in Active Directory or they don’t have the right permissions, they will be redirected to an error page. The permissions are set according to the Active Directory permissions that the user has. Should a user that is supposed to have access see the error page then they will need to contact Desktop Support to resolve the issue.',4,'N','Y','Y',NULL,'','Internal','No Authentication','N/A','',NULL,NULL,NULL,12,'N','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(42,'Account Linking','Account linking setup / maintenance. Contains customer City, State, Zip Code',4,'N','N','Y',NULL,'','Internal','OAM','Application Manager (legacy apps)','',NULL,NULL,NULL,12,'Y','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(43,'Account Linking Admin','Account linking setup/maintenance. Contains customer City, State, Zip Code',4,'N','Y','Y',NULL,'','','','','',NULL,NULL,NULL,10,'','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(44,'Account Opening IP Lookup','used to view the create date, IP address, credit score and the application information provided whether the account was opened or halted in the process.',4,'N','N','Y',NULL,'','','','','',NULL,NULL,NULL,12,'','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(45,'Account Search','Gets account data from CRI. Has account referral # only. Usage went way down once CRM implemented.',4,'N','N','Y',NULL,'','','','','',NULL,NULL,NULL,10,'','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(46,'ACHRDCAdmin','Admin tool for ACH and RDC',4,'N','N','Y',NULL,'','Internal','OAM','Application Manager (legacy apps)','',NULL,NULL,NULL,10,'N','2014-06-03 21:30:22',NULL,'2014-06-03 21:30:22',NULL),(47,'Actimize','Actimize, “AML - SAM” (Anti-Money Laundering – Suspicious Activity Monitori